import React from "react";
import Announce from "../components/Announce";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import styled from "styled-components";

const Container = styled.div``;
const Wrapper = styled.div`
padding:20px;`;
const Title = styled.h1`
font-weight:300; 
text-align:center;
`;
const Top= styled.div`
display:flex;
text-align:center;
justify-content:space-between;
padding:20px;
`
const TopButton=styled.button`
font-weight:600;
padding:10px;
border:${props=>props.type==="field" && "none"};
background-color:${props=>props.type==="field" ? "black" : "transparent"};
color:${props=>props.type==="field" && "white"};
`
const Bottom=styled.div`

`
const TopTexts=styled.div`

`
const TopText=styled.span`
text-decoration:underline;
cursor:pointer;
margin:0px 10px;
`

const Info=styled.div`
`
const Summaryfo=styled.div`
`
const Cart = () => {
  return (
    <div>
      <Container>
        <Navbar /> 
        <Announce />
        <Wrapper>
          <Title>YOUR CART</Title>
          <Top>

              <TopButton>CONTINUE SHOPPING</TopButton>
              <TopTexts>

                  <TopText>Shopping List</TopText>
                  <TopText>Your Wishlist</TopText>
              </TopTexts>
              <TopButton type="field" >CHECKOUT NOW</TopButton>
          </Top>
          <Bottom>

              <Info></Info>
              <Summary></Summary>
          </Bottom>
        </Wrapper>
        Cart
        <Footer />
      </Container>
    </div>
  );
};

export default Cart;
